import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import Home from "./Routes/Home"


function App() {
  return (
      <div className="App">
        <BowserRouter>
          <Navbar/>
            <Routes>
              <Route path="/" element={<Home/>}/>
            </Routes>
        </BowserRouter>
        <Footer/>
      </div>
  );
}

export default App;
